import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

function navbarS() {
  return (
    <header>
        <div class="inner">
            <div class="logo">
                <div>
                    <img src="assets/logo.png" alt="Google logo"/>
                    <h1>My Logo</h1>
                </div>
            </div>
        </div>
    </header>
  )
}

export default navbarS;
